import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch, NavLink, } from 'react-router-dom';

import rater_changeInfo from "./rater_changeInfo";
import rater_main from "./rater_main";
import rater_main2 from "./rater_main2";
import Rater_fileDetail from "./rater_fileDetail";
import Rater_taskDetail from "./rater_taskDetail";

import "./rater.css";

function rater() {
  return (
      <Router>
        <div className="admin">
            <body>
                <div className="fixed-header">
                    <div className="container">
                        <nav>
                            <a className="n" href="/submit/main">태스크 목록</a>
                            <a className="n" href="/submit/main2">참여중인 태스크</a>

                            <a className="nr" href="/">Log out</a>
                            <a className="nr" href="/submit/changeinfo">개인정보 수정</a>
                        </nav>
                    </div>
                </div>
                <Switch>
                    <Route exact={true} path="/rater/rater_main" component={rater_main}/>
                    <Route exact path="/rater/rater_main2" component={rater_main2}/>
                    <Route exact path="/rater/rater_changeInfo" component={rater_changeInfo}/>
                    <Route exact path="/rater/rater_fileDetail" component={Rater_fileDetail}/>
                    <Route exact path="/rater/rater_taskDetail" component={Rater_taskDetail}/>
                </Switch>
            </body>
        </div>
      </Router>
  );
}

export default rater;
